import Vue from 'vue'
import VueRouter from 'vue-router'

// Page
import MasterLayout from '@/pages/layout'
import Home from '@/pages/home'

Vue.use(VueRouter)

export default new VueRouter({
  routes: [
    {
      path: '/',
      component: MasterLayout,
      redirect: '/home',
      children:[
        {
          path: '/home',
          component: Home,
          name: 'Home'
        },
      ]
    }
  ]
})
